import React from 'react'
import styled from 'styled-components';
import lines from '../assets/lines.png'

const Style = styled.div`


	display: flex;
	flex-direction: column;
	position: relative;
	width: 788px;
	margin-bottom: 250px;
	margin-left: auto;
	margin-right: auto;
	padding-top: 0px;

	height: 100vh;


	&::before {
		position: absolute;
		left: 390px;
		margin-top: 27%;
		margin-left: auto;
		margin-right: auto;
		content:'${(props) => props.phasetext}';
		width: 10px;
		white-space: pre-line;
		line-height: 4rem;
		font-size: 1.2rem;
		font-weight: bold;
		color: #888;
	}

	img {
		position: fixed;
		margin-bottom: 0;
	}
`;

function Timeline(props) {
	return (			
		<Style phasetext={props.phasetext}>
			<img src={lines} alt='timelines'></img>
			{props.children}
		</Style>			
	)
}

export default Timeline;
